--create database cinema

create table Cities (
    CityId int primary key,
    CityName varchar(255)
);

create table Branches (
    BranchID int primary key,
    BranchName varchar(255),
    Address varchar(255),
    CityId int foreign key references Cities(CityId)
);

create table Employees (
    EmployeeId int primary key,
    BranchID int foreign key references Branches(BranchID),
    EmployeeName varchar(255),
    Position varchar(255),
    ContactNumber varchar(20),
    Email varchar(255)
);

create table Movies (
    MovieId int primary key,
    MovieTitle varchar(255),
    Director varchar(255),
    Genre varchar(255),
    Duration int,
    ReleaseDate date
);

create table Prices (
    PriceId int primary key,
    MovieId int foreign key references Movies(MovieId),
    TicketType varchar(255),
    Price int
);

create table Shifts (
    ShiftId int primary key,
    ShiftTime varchar(255)
);

create table EmployeeShifts (
    EmployeeShiftId int primary key,
    EmployeeId int foreign key references Employees(EmployeeId),
    ShiftId int foreign key references Shifts(ShiftId),
    Date date
);

create table Rooms (
    RoomId int primary key,
    BranchID int foreign key references Branches(BranchID),
    MovieId int foreign key references Movies(MovieId),
    RoomNumber varchar(255),
    Capacity int
);

create table Seats (
    SeatId int primary key,
    RoomId int foreign key references Rooms(RoomId),
    SeatNumber varchar(255),
);

create table LoyaltyCustomers (
    CustomerId int primary key,
    CustomerName varchar(255),
    ContactNumber varchar(20),
    Email varchar(255),
);

create table Reservations (
    ReservationId int primary key,
    MovieId int foreign key references Movies(MovieId),
    CustomerId int foreign key references LoyaltyCustomers(CustomerId),
    ReservationDate date,
    ReservationTime varchar(255),
    SeatId int foreign key references Seats(SeatId)
);

create table Schedule (
    ScheduleId int primary key,
    MovieId int foreign key references Movies(MovieId),
    RoomId int foreign key references Rooms(RoomId),
    ShiftId int foreign key references Shifts(ShiftId),
    Date date
);

create table Food (
    FoodId int primary key,
    BranchID int foreign key references Branches(BranchID),
    FoodName varchar(255),
    Price int
);

